import { RiFacebookCircleFill } from 'react-icons/ri'
import Facebook from '../navbar-components/facebook'
import { Link } from 'react-router-dom'

export default function Navbar(){


    return(
        <>
          <nav>
            <Link to="/facebook"> <RiFacebookCircleFill /> </Link>
          </nav>
        </>
    )
}
